	        this.i1e12=ti1[5];
	        this.i1e20=ti1[6];
	        this.i1e21=ti1[7];
	        this.i1e22=ti1[8];

	        this.i2e00=ti2[0];
	        this.i2e01=ti2[1];
	        this.i2e02=ti2[2];
	        this.i2e10=ti2[3];
	        this.i2e11=ti2[4];
	        this.i2e12=ti2[5];
	        this.i2e20=ti2[6];
	        this.i2e21=ti2[7];
	        this.i2e22=ti2[8];

	        this.ax1x=this.r1z*this.i1e01+-this.r1y*this.i1e02;
	        this.ax1y=this.r1z*this.i1e11+-this.r1y*this.i1e12;
	        this.ax1z=this.r1z*this.i1e21+-this.r1y*this.i1e22;
	        this.ay1x=-this.r1z*this.i1e00+this.r1x*this.i1e02;
