	        this.az1z=this.r1y*this.i1e20+-this.r1x*this.i1e21;
	        this.ax2x=this.r2z*this.i2e01+-this.r2y*this.i2e02;
	        this.ax2y=this.r2z*this.i2e11+-this.r2y*this.i2e12;
