	        this.d10=(k12*k20-k10*k22)*inv;
	        this.d11=(k00*k22-k02*k20)*inv;
	        this.d12=(k02*k10-k00*k12)*inv;
	        this.d20=(k10*k21-k11*k20)*inv;
	        this.d21=(k01*k20-k00*k21)*inv;
	        this.d22=(k00*k11-k01*k10)*inv;

